import React, {Component} from 'react';
import Header from "../Header/Header";
import MenuRight from "../MenuRight/MenuRight";
import Style from "../Satisfaction/Satisfaction.module.scss";

class Results extends Component {
    render() {
        return (
            <div>
                <Header tour={this.props.tour} pseudo={this.props.pseudo} bassin={this.props.bassin}
                        role={this.props.role} numeroPhase={7} h={0} m={2} s={30} finishEvent={this.props.onClickEvent}/>
                <div className="row">
                    <div className="col-sm-2">
                        <MenuRight pseudo={this.props.pseudo}
                                   role={this.props.role}/>
                    </div>
                    <div className="col-sm-10 text-center">
                        <section className={Style.section}>
                            <header>
                                <h2> RÃ©sultats du tour </h2>
                            </header>
                            <img className={<style>width: 90%</style>} data={this.props.data} alt={"."}/>
                        </section>
                        <button onClick={this.props.onClickEvent}>Next Turn</button>
                    </div>
                </div>
            </div>
        );
    }
}


export default Results;
